        <div className={d.dialog}>
       {/*   <img className={d.img} src={dialogProps.avalink}/>*/}
            <img className={d.img} src='https://img2.goodfon.ru/original/1600x1200/e/c7/risunok-mazki-shtrihi-devushka.jpg'/> <NavLink to={path}>{dialogProps.name}</NavLink>

</div>
)
}

